import React from "react";


const InformationOfThePatiente = (props) => {
  const { info, show  } = props
  return (
    <div >
        <div class="form-check form-check-inline">
            <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="speciality" checked />
            <label class="form-check-label" for="inlineRadio1">Speciality</label>
        </div>
        <div class="form-check form-check-inline">
            <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="lastname" />
            <label class="form-check-label" for="inlineRadio2">Lastname</label>
        </div>
    </div>
  );
}

export default InformationOfThePatiente;
